import React from 'react';
import { LineChart, Line, XAxis, YAxis, Label, ResponsiveContainer,Tooltip,Legend  } from 'recharts';
import Title from './Title';

// Generate Sales Data
function createData(time, amount) {
  return { time, amount };
}

const data = [
  createData('00:00', 0),
  createData('03:00', 300),
  createData('06:00', 600),
  createData('09:00', 800),
  createData('12:00', 1500),
  createData('15:00', 2000),
  createData('18:00', 2400),
  createData('21:00', 2400),
  createData('24:00', undefined),
];

export default function Chart() {
  return (
    <React.Fragment>
      <Title>Today</Title>
      <ResponsiveContainer>
        <LineChart
          
          data={data}
          margin={{
            top: 16,
            right: 16,
            bottom: 0,
            left: 24,
          }}
        >
          <XAxis dataKey="time">
            <Label angle={0} position="right" style={{ textAnchor: 'middle' ,paddingTop:'10'}} >
             SUCCESS
            
            </Label>
          </XAxis> 
          <YAxis>
            <Label angle={270} position="left" style={{ textAnchor: 'middle' }}>
             SUCCESS
            </Label>
          </YAxis>
          <Line type="monotone" dataKey="amount" stroke="#556CD6"  />
          <Line type="monotone" dataKey="uv" stroke="#82ca9d" />
          <Legend />
          <Tooltip />
        </LineChart>
      </ResponsiveContainer>
    </React.Fragment>
  );
}
